    ccxt.AddElementToObject(orderbook, "datetime", this.Iso8601(timestamp))
    ccxt.AddElementToObject(orderbook, "nonce", this.SafeInteger(delta, "u"))
    var bids interface{} = this.SafeList(delta, "b", []interface{}{})
